import defaultProfile from './assets/defaultProfile.png';

const Navbar = () => {
  return (
    <nav style={styles.navbar}>
      <img 
        src={defaultProfile} 
        alt="Profile" 
        style={styles.profileImage}
      />

      <ul style={styles.links}>
        <li style={styles.link}><a href="/">Home</a></li>
        <li style={styles.link}><a href="/about">About</a></li>
        <li style={styles.link}><a href="/services">Services</a></li>
        <li style={styles.link}><a href="/contact">Contact</a></li>
      </ul>
    </nav>
  );
};

const styles = {
  navbar: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '10px 20px',
    backgroundColor: '#333',
    color: '#fff',
  },
  profileImage: {
    width: '60px',
    height: '60px',
    borderRadius: '50%',
    objectFit: 'cover', 
    clipPath: 'circle(38% at 50% 50%)',
  },
  links: {
    listStyle: 'none',
    display: 'flex',
    margin: 0,
    padding: 0,
  },
  link: {
    marginLeft: '20px',
  },
};

export default Navbar;
